import "./Cart.css"
function Cart() {

    let data=JSON.parse(localStorage.getItem("product"))
    console.log("s",data);




  return (
    <div>
        {/* <label>Products Added in cart ({data.length})</label> */}

        <table className='table'>
            <thead>
                 <tr>
                    <th>Sr No</th>    
                    <th>Item</th> 
                    <th>quantity</th>   
                    <th>Price</th>   
                 </tr>   
            </thead>
            <tbody>
                    {
                        data.map((data,index)=>{
                            return(
                                <tr key={index}>
                                    <td>{index+1}</td>     
                                    <td>{data[index].title}</td>
                                     <td>0</td>   
                                    {/* <td>{data!=null && data[0].price}</td> */}
                                    <td></td>
                                </tr>
                            );
                        })

                    }



            </tbody>
        </table>
    </div>
  )
}

export default Cart
